ann_description_public:
In this toy example, features are generated according to four 2-dimensional isotropic Gaussian distributions with different mean _μ_ and variance _σ²_. Each of the four distributions corresponds to a different combination of binary label _y_ and protected attribute s as follows:
(1) _s_ = _a_, _y_ = +1: _μ_ = (−1, −1), _σ²_ = 0.8;  
(2) _s_ = _a_, _y_ = −1: _μ_ = (1, 1), _σ²_ = 0.8;  
(3) _s_ = _b_, _y_ = +1: _μ_ = (0.5, −0.5), _σ²_ = 0.5;  
(4) _s_ = _b_, _y_ = −1: _μ_ = (0.5, 0.5), _σ²_ = 0.5.

